UML:TaggedValue.value:
Returns the AAL applications that were uploaded by the user in the following structure. 
&lt;applications&gt;
&lt;application&gt;&lt;id&gt;application-id&lt;/id&gt;&lt;name&gt;application-name&lt;/name&gt;&lt;/application&gt;
&lt;application&gt;...&lt;/application&gt;
&lt;/applications&gt;
username is the name of the user who invokes this call.
password is the password of the user who invokes this call.
parentCategoryId is the identifier of the parent category to be searched

Returns the categories under the 'AAL Applications' category organized in the following structure. 
&lt;categories&gt;
&lt;category&gt;&lt;id&gt;category-id&lt;/id&gt;&lt;name&gt;category-name&lt;/name&gt;&lt;/category&gt;
&lt;category&gt;...&lt;/category&gt;
&lt;/categories&gt;
username is the name of the user who invokes this call.
password is the password of the user who invokes this call.
